        <ButtonImage img_path="./nic.png" name="Ethernet Network Adapter" className="inline-block"/>
        <ButtonImage img_path="./module.png" name="Ethernet Network Adapter" className="inline-block"/>
        <ButtonImage img_path="./tools.png" name="Ethernet Network Adapter" className="inline-block"/>
        <ButtonImage img_path="./info.png" name="Ethernet Network Adapter" className="inline-block"/>
      </div>
    </div>
  );

}
